		function gameTicker() {
			//        .        ,  
			for (i = 0; i < 3; i++) {
				if ((stage.getChildByName("cloud" + i).x) < -100) {
					cloudRNDY = Math.floor(Math.random() * 400) + 0; //     
					stage.getChildByName("cloud" + i).x = 1380; //      
					stage.getChildByName("cloud" + i).y = cloudRNDY;
				}
				stage.getChildByName("cloud" + i).x -= 0.2; //  0.2 
			}
			//           
			if (backMove == true && qNum < buildingBlox.length) {
				console.log(qNum);
				//    -20     
				if (backgroundMovement < 20) {
					background.y += 110 / 20; //   110/20. 110      .        
					ground.y += 110 / 20 - 0.1; //  .           
					//           , .        
					for (i = 0; i < qNum; i++) {
						stage.getChildByName("block" + i).y += 110 / 20 - 0.1; //-0.1          
					}
					backgroundMovement++; //  
					//     20,     
				} else {
					backMove = false; //     
					backgroundMovement = 0; //    
				}
			}
			//            
			if (displayed == true) {
				//                
				for (i = 0; i < (buildingBlox[rndQ].length - 1); i++) {
					//           1.  ,    0.8
					if (intersect((stage.getChildByName("checkline")), (stage.getChildByName("answer" + i)))) {
						stage.getChildByName("answer" + i).alpha = 1;
					} else {
						stage.getChildByName("answer" + i).alpha = 0.8;
					}
				}
			}
			//             .         
			if (endA == true) {
				//                   
				for (i = 0; i < (buildingBlox.length); i++) {
					stage.getChildByName("block" + i).y -= 0.5;
				}
				background.y -= 0.5;//   
				ground.y -= 0.5;//   
				//          
				for (i = 0; i < 3; i++) {
					stage.getChildByName("cloud" + i).y -= 0.2
				}
		//        
				if (ground.y < 750) {
					chuteDown = true;//         
					endA = false;//        
				}
			}
			//  ,     
			if (chuteDown == true) {
				workerChute.alpha -= 0.1;//  -0.1   0
				//   0       
				if (workerChute.alpha == 0) {
					stage.removeChild(workerChute);
					chuteDown = false;
				}
			}
		}
